import React, { useState, useEffect } from 'react';
import Card from '@material-ui/core/Card';

import  styles from './App.module.css';
import { WeatherDisplay } from './WeatherDisplay/WeatherDisplay';

const PLACES = [
  { name: "Palo Alto", zip: "94303", id: 1 },
  { name: "San Jose", zip: "94088", id: 2 },
  { name: "Santa Cruz", zip: "95062", id: 3 },
  { name: "Honolulu", zip: "96803", id: 4 }
];

const App = () => {
  return (
    <div >
      <WeatherDisplay zip={"12345"} />
      {PLACES.map((place) => (
      <button
        key={place.id}
        onClick={() => {
          console.log('Clicked index '+place.id);
        }}
      >
          {place.name}
      </button>
    ))}
  </div>

);
};

export default App;
